import banner_img from './assets/homedisplay.png';

const Banner = () => {
    return(
        <div className='row mt-4'>
            <img className="homedisplay" src={banner_img} alt='titikman-banner'/>
        </div>
    );

}


const Card = () => {
    return(
        <>
            <div class="col-md-4 mb-4">
                <div class="card" style="min-width: 300px;">
                <a href="subway.html">
                    <img src="assets/subway.jpg" class="card-img-top" alt="Food Image 1" style="width: 100%; height: auto;"/>
                </a>
                <div class="card-body">
                    <h5 class="card-title">Subway</h5>
                    <div class="rating">
                    <span class="rating-number">1.3</span>
                    <div class="stars">
                        <span class="fas fa-star checked"></span>
                        <span class="fas fa-star-half-alt checked"></span>
                        <span class="far fa-star"></span>
                        <span class="far fa-star"></span>
                        <span class="far fa-star"></span>
                    </div>
                    </div>
                </div>
                </div>
            </div>
        
        </>
    );
}

const Home = () => {

    return(
        <div className='Home'>
            <Banner />

            <div className="container-fluid" style="margin-top: 20px;">
                <div className='row'>
                    <Card />
                </div>

            </div>

        </div>


    );
    
}

export default Home;
